// SPDX-License-Identifier: MIT

// Recoge fondos de usuarios
// Te permite recoger esos fondos siendo el propietario del contrato
// Te permite establecer un valor mínimo para que te transfieran calculado en USD

pragma solidity ^0.8.8;

contract FundMe {

    uint256 public minimunUSD = 50;

    function fund() public payable {
    // Queremos establecer una cantidad mínima que nos tengan que ingresar en USD
    // 1. ¿Cómo mandar ETH a este contrato? 0x8A753747A1Fa494EC906cE90E9f37563A8AF630e
        require(msg.value > minimunUSD, "Didn't send enough!!!"); // Con esto estamos haciendo que como mínimo tengan que transferir 1ETH 
        // Lo que hay entre paréntesis: El primer argumento es para seleccionar la cantidad mínima, y el segundo argumento es para que en caso de que la sentencia "require" falle, aparezca el mensaje de error

    }

   // function withdraw() {

